import React from 'react';
import {Link} from "react-router-dom"
import logo from "../navbar/logo_transparent.png";
import "./Home.scss"


function Home(props) {

    return (

          <div>
            <header className="logo">
            <img src={logo} alt="" width="500" heith="300"/>
            </header>

        {/* SECTION GAMES */}
        <div className="all">
        <div className="games">
          <h3>Our best offers Games:</h3>
          {props.games.map(game => (
            <Link to={"game/"+game._id}>
              <div>
                  <img src={game.photo} alt=""/>
                  <h2>{game.title}</h2>
              </div>
            </Link>
          ))}
        </div>


      {/* SECTION CONSOLES */}

      <div>
        <h3>Our best deals on consoles:</h3>
          {props.consoles.map(consol => (
              <Link to={"console/"+consol._id}>
                <div>
                  <img src={consol.photo} alt=""/>
                  <h2>{consol.consoleModel}</h2>
              </div>
              </Link>
          ))}
        </div>
      </div>

      <footer>
        <h5>created by luciano sanchez for ironhack</h5>
      </footer>
      </div>

    )
}

export default Home;
